import Map from './components/Map';
import Dashboard from './components/dashboard'
import Login from './components/Login'

function App() {
  return (
    <>
    {/* <Login /> */}
    <div className="App">

      <Header />
      <Dashboard />
      <Map />
    </div>
    </>
  );
}

export default App;
